// import logo from './logo.svg';
import Gallery from './Gallery.js';
import Profile from './Profile.js';
import Avatar from './Avatar.js';

import './App.css';

const person = {
  name: 'Gregorio Y. Zara',
  theme: {
    backgroundColor: 'black',
    color: 'pink'
  }
};

const square = (val) => { 
  return <button className="square">{val}</button>;
}



const grid = () => {
  return <div>
  <div className="board-row">
    {square(0)}
    {square(1)}
    {square(2)}
  </div>
  <div className="board-row">
    {square(3)}
    {square(4)}
    {square(5)}
  </div>
  <div className="board-row">
    {square(6)}
    {square(7)}
    {square(8)}
  </div>
</div>
}




let App = () => {
  return (
    <div>
      <Avatar
        size={100}
        person={{ 
          name: 'Katsuko Saruhashi', 
          imageId: 'YfeOqp2'
        }}
      />
      <Avatar
        size={80}
        person={{
          name: 'Aklilu Lemma', 
          imageId: 'OKS67lh'
        }}
      />
      <Avatar
        size={50}
        person={{ 
          name: 'Lin Lanying',
          imageId: '1bX5QH6'
        }}
      />


      <Profile />
      <Gallery/>
      <div style={person.theme}>
      <h1>{person.name}'s Todos</h1>
      <img
        className="avatar"
        src="https://i.imgur.com/7vQD0fPs.jpg"
        alt="Gregorio Y. Zara"
      />
      <ul>
        <li>Improve the videophone</li>
        <li>Prepare aeronautics lectures</li>
        <li>Work on the alcohol-fuelled engine</li>
      </ul>
      <div style={{alignContent:'center'}}>{grid()}</div>


    </div>


    </div>


  );
}


export default App;
